import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

function NavBarLogo() {
    return (
      <div>
            <header className='container navbar bg-dark'>
                <h2 className='navbar-brand'>SyA MiMate</h2>
                <a onClick={console.log("Home")} className='link-light'>Home</a>
                <a onClick={console.log("Mates")} className='link-light'>Mates</a>
                <a onClick={console.log("Bombillas")} className='link-light'>Bombillas</a>
                <a onClick={console.log("Yerbas")} className='link-light'>Yerbas</a>
                <a onClick={console.log("Termos")} className='link-light'>Termos</a>
                <a onClick={console.log("Accesorios")} className='link-light'>Accesorios</a>
            </header>
      </div>
    );
  }
  
  export default NavBarLogo;
